import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';

const MiniGame = () => (
    <AppLayout>
        <Head>
            <title>MiniGame</title>
        </Head>
        <div>mainSection</div>
    </AppLayout>
);

export default MiniGame;
